import Link from 'next/link';

const Newsletter = (props) => (
	<div>
		<Link href="/">
			<a style={linkStyle}>Home</a>
		</Link>
		<Link href="/about">
			<a style={linkStyle}>About</a>
		</Link>
	</div>
);

export default Newsletter;
